INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (2, , N'Rápidos y Furiosos X', N'Dominic Toretto ahora tiene la responsabilidad de proteger a su equipo y a su familia de un nuevo y peligroso villano llamado Dante, el cual resulta ser el hijo del antiguo mafioso y narcotraficante brasileno Hernan Reyes. ', N'Louis Leterrier', 1)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (3, , N'Spider-Man: Into the Spider-Verse', N'Miles Morales emprende una aventura a traves del multiverso con Gwen Stacy y un nuevo equipo de la Spider People que deben enfrentar a un poderoso villano.', N'Joaquim Dos Santos, Kemp Powers, Justin K Thompson', 9)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (4, , N'Boogeyman Tu miedo es real', N'Boogeyman. Tu miedo es real es una adaptación del famoso cuento de Stephen King, en la que dos hermanas se ven amenazadas por un ser sobrenatural, mientras que su padre intenta mantener a flote a la familia despues de la muerte de su esposa y madre.', N'Rob Savage', 7)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (5, , N'La Sirenita', N'La Sirenita es la querida historia de Ariel, una sirena joven y apasionada con ansias de aventuras. Ella es la mas joven y rebelde de las hijas del rey Triton, y suena con descubrir el mundo mas alla del mar. ', N'Rob Marshall', 8)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (6, , N'Guardianes Galaxia Vol 3', N'La querida banda de Guardianes se instala en Knowhere. Pero sus vidas no tardan en verse alteradas por los ecos del turbulento pasado de Rocket. ', N'James Gunn', 6)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (7, , N'Super Mario Bros', N'La pelicula cuenta la historia de Mario y Luigi, dos hermanos que viajan a un mundo oculto para rescatar a la Princesa Peach, capturada por el malvado Rey Bowser.', N'Aaron Horvath, Michael Jelenic', 9)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (8, , N'Transformers el Despertar', N'Transformers. El despertar de las bestias llevara al publico a una aventura alrededor del mundo en los 90 con los Autobots e introducira a una nueva generacion de Transformers, los Maximals, para unirlos en la batalla existente por la tierra. ', N'Steven Caple Jr', 1)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (9, , N'Flash', N'Los mundos chocan en Flash cuando Barry usa sus Superpoderes para viajar en el tiempo y cambiar los eventos del pasado.', N'Andy Muschietti', 1)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (10, , N'J hope IN THE BOX', N'Un documental que demuestra lo apasionado y lo preocupado que es J Hope por ser un artista completo y que ama lo que hace.', N'Jun Soo Park', 4)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (11, , N'SUGA Road to D DAY', N'Sigue a la estrella de BTS, SUGA, mientras viaja por todo el mundo en busca de inspiracion musical para su proximo album D DAY, desde Seul hasta Tokio, Las Vegas y mas alla.', N'Jun-Soo Park', 10)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (12, , N'Demonio Negro', N'Mientras Paul Sturges se va de vacaciones a Bahia Azul con su familia, desde las profundidades del mar se eleva un enorme megalodon conocido solo por su nombre. El Demonio Negro.', N'Adrian Grunberg', 6)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (13, , N'Elementos', N'La historia nos presenta a Ember, una joven dura, ingeniosa y feroz, cuya amistad con un chico divertido y que se deja llevar por la corriente, llamado Wade, desafia sus creencias sobre el mundo en el que viven.', N'Peter Sohn', 9)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (14, , N'Barbie', N'de ser expulsada de Barbieland por no ser una muñeca de aspecto perfecto, Barbie parte hacia el mundo humano para encontrar la verdadera felicidad.', N'Greta Gerwig', 3)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (15, , N'La Ultima Profecía', N'En un abrir y cerrar de ojos, un rapto bíblico azota el mundo. Millones de personas desaparecen sin dejar rastro. Todo lo que queda es su ropa y sus pertenencias, y en un instante, el terror y el caos invade a la humanidad.', N'Vic Armstrong', 7)
GO
INSERT [dbo].[Peliculas] ([Id], [PosterImg], [Titulo], [Sinopsis], [Director], [IdGenero]) VALUES (16, , N'El Imperio de la Luz', N'Ambientada en una ciudad costera inglesa a principios de la década de 1980, "Imperio de la luz" es una poderosa y conmovedora historia sobre la conexión humana y la magia del cine.', N'Sam Mendes', 4)
GO
